        new( "IsPlanetStrongInShadbala(PlanetNameplanet,Timetime)","12196",""," Significance of being Powerful.Among the several planets associated with a bhava that which has the greatest Sbadbala influences the bhava most. Powerful Planets.Ravi is befd to be powerful when his Shadbala Pinda is 5 or more rupas. Chandra becomes strong when his Shadbala Pinda is 6 or more rupas. Kuja becomes powerful when bis Shadbala Pinda does not fall short of 5 rupas.Budha becomes potent by having his Sbadbala Pinda as 7 rupas Guru Sukra and Sani become thoroughly powerful if their Shadbala Pindas are 6.5 5.5 and 5 rupas or more respectively. ",""),
        new( "IsHouseBeneficInShadbala(HouseNamehouse,TimebirthTime,doublethreshold)","12226",""," sets benefic if above 450 score ",""),
        new( "AllPlanetStrength(Timetime)","12239",""," Gets strength shadbala of all 9 planets ",""),
        new( "AllHousesOrderedByStrength(Timetime)","12261",""," Returns an array of all houses sorted by strength 0 index being strongest to 11 index being weakest ",""),
        new( "PlanetShadbalaPinda(PlanetNameplanetName,Timetime)","12319",""," THE FINAL TOTAL STRENGTH Shadbala the six sources of strength and weakness the planets The importance of and the part played by the Shadbalas in the science of horoscopy are manifold In order to obtain the total strength of the Shadbala Pinda of each planet we have to add together its Sthana Bala Dik Bala Kala Bala. Chesta Bala and Naisargika Bala. And the Grahas Drik Bala must be added to or subtracted from the above sum according as it is positive or negative. The result obtained is the Shadbala Pinda of the planet in Shashtiamsas. Note Rahu Ketu supported via house lord ",""),
        new( "PlanetStrength(PlanetNameplanetName,Timetime)","12385",""," get total combined strength of the inputed planet input birth time to get strength in horoscope note an alias method to GetPlanetShadbalaPinda strength is easier to remember ",""),
        new( "PlanetDrikBala(PlanetNameplanetName,Timetime)","12419",""," Aspect strength This strength is gained by the virtue of the aspect Graha Dristi of different planets on other planet. The aspect of benefics is considered to be strength and the aspect of malefics is considered to be weaknesses. Drik Bala.This means aspect strength. The Drik Bala of a Gqaha is onefourth of the Drishti Pinda on it. It is positive or negative according as the Drishti Pinda is positive or negative. See the formula given on page 85. There is special aspect for Jupiter Mars and Saturn on the 5th and 9th 4th and 8th and 3rd and 10th signs respectively. ",""),
        new( "FindViseshaDrishti(doubledk,PlanetNamep)","12494",""," Get special aspect if any of Kuja Guru and Sani ",""),
        new( "FindDrishtiValue(doubledk)","12534","","Empty sample text",""),
        new( "PlanetNaisargikaBala(PlanetNameplanetName,Timetime)","12578",""," Nalsargika Bala.This is the natural strength that each Graha possesses. The value assigned to each depends upon its luminosity. Ravi the brightest of all planets has the greatest Naisargika strength while Sani the darkest has the least Naisargika Bala. This is the natural or inherent strength of a planet. ",""),
        new( "PlanetChestaBala(PlanetNameplanetName,Timetime,booluseSpecialSunMoon)","12621",""," NOTE sun moon get score for ISHTAKESHA calculation only when specified for IshataKashta MOTIONAL STRENGTH Chesta here means Vakra Chesta or act of retrogression. Each planet except the Sun and the Moon and shadowy planets get into the state of Vakra or retrogression when its distance from the Sun exceeds a particular limit. And the strength or potency due to the planet on account of the arc of the retrogression is termed as Chesta Bala Deduct from the Seeghrocbcha half the sum of the True and Mean Longitudes of planets and divide the difference by 3. The quotient is the Chestabala. Max 60 meaning RetrogradeVakra When the distance of any one planet from the Sun exceeds a particular limit it becomes retrograde i.e. when the planet goes from perihelion the point in a planets orbit nearest to the Sun to aphelion the part of a planets oroit most distant from the Sun as it recedes from the Sun it gradually loses the power of the Suns gravitation and consequently ",""),
        new( "SunChestaBala(TimeinputTime)","12720",""," special function to get chesta score for IshtaKashta score Bala book pg. 108 Sun has no Chesta kendra or Chesta bala as he never gets into retrogression. But still a method is prescribed to find his Chesla Bala which is necessary to ascertain the lshta and Kashta Phalas. ",""),
        new( "MoonChestaBala(TimeinputTime)","12741",""," special function to get chesta score for IshtaKashta score Bala book pg. 108 ",""),
        new( "Madhya(doubleepochToBirthDays,Timetime1)","12763",""," The mean position of a planet is the position which it would have attained at a uniform rate of motion and the corrections to be applied in respect of the eccentricity of the orbit are not considered ",""),
        new( "EpochInterval(Timetime1)","12822",""," Get interval from the epoch to the birth date in days The result represents the interval from the epoch to the birth date. ",""),
        new( "PlanetMotionName(PlanetNameplanetName,Timetime)","12857",""," Gets the planets motion name can be Retrograde Direct Stationary a name version of Chesta Bala ",""),
        new( "IsPlanetRetrograde(PlanetNameplanetName,Timetime)","12950",""," A retrograde planet moves in the reverse direction and instead of increasing its longitude decreases as the time elapses. Rahu and Ketu often move in retrograde direction only. Other planets except the Sun and the Moon are subject to retrogression from time to time. ",""),
        new( "IsPlanetCombust(PlanetNameplanetName,Timetime)","13021","planetName: The planet to check for combustion., time: The time at which to check combustion."," Determines if a given planet is combust at a specific time. Combustion of planets Planets when too close to the Sun become invisible and are labelled as combust. A combust planet loses its strength and tends to behave adversely according to predictive astrology. Aryabhata has the following to say about combustion When the Moon has no latitude i.e. when it is at zero degree of latitude it is visible when situated at a distance of 12 degrees from the Sun. Venus is visible when 9 degrees distant from the Sun. The other planets taken in the order of decreasing sizes viz. Jupiter Mercury Saturn and Mars are visible when they are 9 degrees increased by twos i.e. when they are 11 13 15 and 17 degrees distant from the Sun. The degrees as mentioned above are generally taken as the limits within which the respective planets are said to be combust. ",""),
        new( "PlanetCirculationTime(PlanetNameplanetName)","13091",""," circulation time of the objects in years used by cheshta bala calculation ",""),
        new( "PlanetSaptavargajaBala(PlanetNameplanetName,Timetime)","13116",""," Sapthavargajabala This is the strength of a planet due to its residence in the seven subdivisions according to its relation with the dispositor. Saptavargaja bala means the strength a planet gets by virtue of its disposition in a friendly neutral or inimical Rasi Hora Drekkana Sapthamsa Navamsa Dwadasamsa and Thrimsamsa. ",""),
        new( "PlanetSthanaBala(PlanetNameplanetName,Timetime)","13290",""," residence of the planet and as such a certain degree of strength or weakness attends on it Positonal strength A planet occupies a certain sign in a Rasi and friendly neutrai or inimical varga. It is either exalted or debilitated lt ocupies its Moolathrikona or it has its own varga. All these states refer to the position or residence of the planet and as such a certain degree of strength or weakness attends on it. This strength or potency is known as the Sthanabala. 1.Uccha Bala Uccha means exaltation. When a planet is placed in its highest exaltation point it is of full strength and when it is in its deepest debilitation point it is devoid of any strength. When in between the strength is calculated proportionately dependent on the distance these planets are placed from the highest exaltation or deepest debilitation point. 2.Sapta Vargiya Bala Rashi Hora Drekkana Saptamsha Navamsha Dwadasamsha and Trimsamsha constitute the Sapta Varga. The strength of the planets in these seven divisional charts based on their placements in Mulatrikona own sign friendly sign etc. constitute the Sapta vargiya bala. 3.OjaYugma RashiAmsha Bala Oja means odd signs and Yugma means even signs. Thus as the name imply this strength is derived from a planets placement in the odd or even signs in the Rashi and Navamsha. 4.Kendradi Bala The name itself implies how to compute this strength. A planet in a Kendra 14710 gets full strength while one in Panapara 25811 gets half and the one in Apoklimas 12369 gets quarter strength. 5.Drekkana Bala Due to placement in first second or third Drekkana of a sign male female and hermaphrodite planets respectively get a quarter strength according to placements in the first second and third Drekkana. ",""),
        new( "PlanetDrekkanaBala(PlanetNameplanetName,Timetime)","13335",""," Drekkanabala The Sun Jupiter and Mars in the lst Saturn and Mercury in the 2nd and the Moon and Venus in the last Drekkana get full strength of 60 shashtiamsas. ",""),
        new( "PlanetKendraBala(PlanetNameplanetName,Timetime)","13386",""," Kendrtzbala Planets in Kendras get 60 shashtiamsas in Panapara 30 and in Apoklima 15. ",""),
        new( "PlanetOjayugmarasyamsaBala(PlanetNameplanetName,Timetime)","13422",""," Ojayugmarasyamsa In odd Rasi and Navamsa the Sun Mars Jupiter Mercury and Saturn get strength and the rest in even signs ",""),
        new( "PlanetKalaBala(PlanetNameplanetName,Timetime)","13477",""," Gets a planets Kala Bala or Temporal strength ",""),
        new( "PlanetYuddhaBala(PlanetNameinputedPlanet,Dictionary<PlanetName,Shashtiamsa>preKalaBalaValues,Timetime)","13568",""," Two planets are said to be in Yuddha or fight when they are in conjunction and the distance between them is less than one degree. TODO Not fully tested Yuddhabala All planets excepting the Sun and the Moon enter into war when two planets are in the same degree. The pJanet having the lesser longitude is the winner. Find out the sum total of the SthanabaJa Kalabala and Digbala of these two planets. Difference between the two divided by the difference of their diameters of its disc gives the Yuddhabala. Add this to the victorious planet and dedu_ct it from the vanquished. ",""),
        new( "PlanetAyanaBala(PlanetNameplanetName,Timetime)","13679",""," Ayanabala All planets get 30 shasbtiamsas at the equator. For the Sun Jupiter Mars and Venus add proportionately when they are in northern course and for the Moon and Saturn when in southern course. Deduct proportionately when they are in the opposite direction. Unit of strength is 60 shashtiamsas. TODO some values for calculation with standard hooscope out of whack it seems small differences in longitude seem magnified at final value not 100 sure need further testing for confirmation but final values seem ok so far ",""),
        new( "PlanetDeclination(PlanetNameplanetName,Timetime)","13748",""," A heavenly body moves northwards the equator for sometime and then gets southwards. This angular distance from the equinoctial or celestial equator is Kranti or the declination. Declinations are reckoned plus or minus according as the planet is situated in the northern or southern celestial hemisphere ",""),
